import React from "react";
import "./style.css";
import {menutoggle} from "../../images/menutoggle.png"

export default function NavBar() {
  return (
    <div id="navigation-container">
      <div id="nav-toggle">
        <input type="checkbox" id="menu-toggle" name="menu-toggle" />
        <label for="menu-toggle">
            <img src={menutoggle} />
        </label>
      </div>
      <nav>
        <ul>
          <li>Link</li>
        </ul>
      </nav>
    </div>
  );
}
